import React from "react";
import '../css/Menu.css';
import { Navbar, Nav, NavDropdown } from 'react-bootstrap';

export default function Menu(){
    return(
        <Navbar bg="primary" variant="dark" expand="lg">
            <Navbar.Brand href="#home">Stg Community</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="mr-auto">
                    <Nav.Link href="#forum">Forum</Nav.Link>
                    <Nav.Link href="#conversations">Conversations</Nav.Link>
                    <Nav.Link href="#plannings">Plannings</Nav.Link>
                    <Nav.Link href="#documents">Documents</Nav.Link>
                    <Nav.Link href="#activities">Activit√©s scolaires</Nav.Link>
                    <Nav.Link href="#notifications">Notifications</Nav.Link>
                </Nav>
                <Nav>
                    <NavDropdown title={<i className='bx bx-moon'></i>} id="basic-nav-dropdown">
                        <NavDropdown.Item href="#action/3.1">Dark Mode</NavDropdown.Item>
                        {/* Add more dropdown items if needed */}
                    </NavDropdown>
                    <Nav.Link href="#logout"><i className='bx bx-log-out'></i></Nav.Link>
                </Nav>
            </Navbar.Collapse>
        </Navbar>
    );
}
